INSERT INTO `ricetta` (`idRicetta`, `ingredienti`, `procedimento`, `categoria`, `data`, `autore`, `nomeRicetta`, `dosiPersone`, `idImmagine`, `valutazione`) VALUES
(11, 'a:8:{i:0;s:23:\"macinato di manzo 600g \";i:1;s:15:\"sale e pepe q.b\";i:2;s:17:\"olio di oliva 30g\";i:3;s:15:\"cheddar 4 fette\";i:4;s:22:\"cetrioli sotto aceto 4\";i:5;s:10:\"pomodoro 1\";i:6;s:13:\"bacon 4 fette\";i:7;s:16:\"lattuga 4 foglie\";}', 'il cheeseburger  la quintessenza della semplicit, devono esserci solo, pane, carne, formaggio e al massimo bacon. Tutto qui, niente cipolla, pomodoro o altre frivolezze. Non  un panino gourmet e non lo vuole essere.\n\nE ha ragione da vendere, soprattutto se prendete carne di prima scelta, non serve molto, anche se la combo di lattuga-pomodoro-cipolla rinfresca e spezza un attimo il mattone, diciamo.\n\nSfumature, la cosa importante  scegliere un formaggio vero, niente sottilette o formaggini industriali. Non  necessario scegliere il Cheddar, in Italia abbiamo centinaia di tipi di formaggio, anzi siamo secondi al mondo, dopo la Francia, per tipologie di formaggi, quindi non cadiamo nellerrore di rovinare un buon hamburger con formaggio non allaltezza!\n\nOk, partiamo, come sempre dalla carne: il taglio top  la spalla, con un buon mix di grasso e carne, ma anche lo spinacino,  un ottimo pezzo di carne da cui ricavare hamburger. Dipende da quello che trovate dal vostro macellaio di fiducia.\n\nMacina carne per hamburger e cheeseburger americani. Come fare cheeseburger Macellaio che maciner sotto i vostri occhi la carne, non comprate mai il macinato. Prima e unica regola del Cheeseburger Club.\n\nBene, adesso condite il macinato con un cucchiaino raso di sale, 3 macinate di pepe 1 cucchiaio di maggiorana e 1 cucchiaino di semi di finocchio e impastate con le mani.\n\nIl sapore aromatico, quasi balsamico dei semi di finocchio aggiunge un tocco delizioso e spezza la monotonia della carne, rendendo il panino pi sfumato di gusto. Se non vi piace il finocchio, potete mettere anche cumino. Se non piace neanche il cumino non mettete niente e siamo a posto.\n\nFormate 4 palle tonde con la carne e poi appiattitele, schiacciando con il palmo della mano. Con il pollice spingete in mezzo allhamburger creando un piccola rientranza, cos non si spappoleranno n si gonfieranno durante la cottura.\n\nHamburger di carne con maggiorana e semi di finocchio per cheeseburger Se vi piacciono gli hamburger, la pressa per fare gli hamburger Zyliss  uno strumento che vi consigliamo:  facilissima da usare, potrete regolare lo spessore degli hamburger e vi far risparmiare molto tempo. Il tutto a fronte di una spesa molto contenuta, ci sono anche prodotti pi economici, ma non sono minimamente paragonabili.\n\nTagliate il formaggio Cheddar a fette spesse 1 cm.\n\nFriggete la pancetta o il bacon in padella fino a quando non  croccante, ma non secco: 10 minuti sono sufficienti. Scolate il grasso e mettetelo sulla carta assorbente.\n\nTagliate il pane a met.\n\n fondamentale che tutto sia pronto, cos potrete cuocere gli hamburger tutti insieme e poi comporli, senza dover aspettare per gli altri ingredienti.\n\nPreparate la griglia per una cottura a calore diretto, fuoco medio.\n\nHamburger di carne per preparare cheeseburger americano. Ricetta originale. Grigliate gli hamburger per 10 minuti in tutto.\n\nQuando manca 1 minuto alla fine della cottura, mettete il formaggio e il pane sulla griglia. 30 secondi per lato, quindi togliete gli ingredienti mano a mano che preparate i singoli hamburger.\n\nGli altri spostateli su una zona senza brace. Se usate il barbecue a gas, spegnetelo. Come vedete dalla foto, un ottimo barbatrucco  lasciare il formaggio sulla carne, cosicch si sciolga con calma.\n\nOk, per comporre il cheeseburger prendete il pane e mettete subito la fettina di bacon che impregni il pane, la carne, il formaggio Cheddar, se vi piace molto il formaggio una fettina sottile di asiago, maionese e coprite con laltra met del panino.\n\nServite il vostro regale cheeseburger e guardate lo sguardo di stupore e beatitudine sul volto dei vostri commensali.\n\nCheeseburger con carne, Cheddar, cipolla, pomodoro e lattuga. Ricetta bbq Se invece preferite un cheeseburger pi elaborato, ma anche meno monolitico come gusto, aggiungete 1 fetta di cipolla rossa, 1 fetta di pomodoro e 2 foglie di lattuga, tutto a crudo.\n\nBacon cheeseburger ricetta, come preparare l\'hamburger di carne perfetto ricetta Per chi non ha paura di colesterolo e grassi e deve andare a fare il tagliaboschi in Canada, potete aumentare le dosi di bacon, per un bacon cheeseburger che far tremare le vostre coronarie.', 3, '2022-02-26', 1, 'Cheeseburger', 4, 11, 2),
(12, 'a:8:{i:0;s:14:\"Savoiardi 200g\";i:1;s:18:\"Panna Fresca 500ml\";i:2;s:15:\"Mascarpone 250g\";i:3;s:12:\"Fragole 500g\";i:4;s:21:\"Succo d\'Arancia 400ml\";i:5;s:21:\"Zucchero Semolato 40g\";i:6;s:19:\"Zucchero a Velo 60g\";i:7;s:23:\"Estratto di Vaniglia 5g\";}', 'Come prima operazione prepariamo la bagna e le fragole per il ripieno. In una terrina capiente mettete le fragole tagliate a cubetti, aggiungete lo zucchero semolato e bagnate con il succo darancia.\r\n\r\nTiramis alle fragole - Step 2\r\nMescolate fino a sciogliere completamente lo zucchero, quindi fate macerare le fragole nel succo darancia per almeno mezzora.\r\n\r\nTiramis alle fragole - Step 3\r\nNel frattempo preparate la crema. In una ciotola capiente mettete la panna, il mascarpone, lo zucchero a velo e lestratto di vaniglia.\r\n\r\nTiramis alle fragole - Step 4\r\nLavorate tutti gli ingredienti con una frusta elettrica fino ad ottenere una crema soda e ben montata. Conservate la crema in frigo fino al momento del suo utilizzo.\r\n\r\nTiramis alle fragole - Step 5\r\nTrascorsa la mezzora, prelevate con una schiumarola met delle fragole messe a macerare e tenetele da parte. Frullate le fragole restanti direttamente nel succo di arancia; per questa operazione potete usare un classico frullatore o un frullatore ad immersione. Questa che avete appena realizzato sar la bagna per i savoiardi.\r\n\r\nPubblicit\r\n\r\nTiramis alle fragole - Step 6\r\nSiamo pronti per assemblare il tiramis. Sporcate il fondo di una pirofila (la mia  quadrata e misura 25 cm di lato) con un paio di cucchiaiate di crema alla panna, quindi fate un primo strato di savoiardi ben imbevuti nella bagna di arance e fragole.\r\n\r\nTiramis alle fragole - Step 7\r\nRicoprite tutto con un generoso strato di crema alla panna, quindi distribuite le fragole messe a macerare in precedenza.\r\n\r\nTiramis alle fragole - Step 8\r\nFate un altro strato di savoiardi (sempre imbevuti nella bagna), quindi ricoprite con la crema di panna restante e livellate per bene. Fate riposare il tiramis in frigo per almeno 4 ore.\r\n\r\nTiramis alle fragole - Step 9\r\nDopo il riposo, siamo pronti per decorare il tiramis secondo i nostri gusti. Io ho creato un semplice motivo a righe con delle fettine di fragole, quindi ho decorato con qualche fogliolina di menta. Se volete dare un aspetto lucido alle fragole potete spennellarle con un po di gelatina neutra a freddo.\r\n\r\nTiramis alle fragole - Step 10\r\nEcco il tiramis alle fragole servito in tavola! I suoi bellissimi colori rallegreranno le tavole del periodo primaverile!', 6, '2022-02-27', 1, 'Tiramis alle fragole', 8, 12, 0),
(13, 'a:5:{i:0;s:14:\"Spaghetti 160g\";i:1;s:13:\"Guanciale 60g\";i:2;s:18:\"2-3 Tuorli freschi\";i:3;s:19:\"Pecorino Romano 25g\";i:4;s:21:\"Pepe nero e sale q.b.\";}', 'Come fare gli Spaghetti alla carbonara\r\nPrima di tutto tagliate il guanciale a quadretti e porre in padella:\r\n\r\nTagliare il guanciale a dadini - Ricetta Pasta alla carbonara\r\nPoi ponete su fuoco una pentola capiente con acqua e sale grosso per bollire gli spaghetti. Quando bolle, buttateli.\r\n\r\nContemporaneamente scaldate su fuoco dolce il guanciale in padella.\r\n\r\nil guanciale non deve indurirsi friggendosi troppo, ma deve ammorbidirsi dolcemente, rilasciando tutto il grasso servir per saltare gli spaghetti in padella.\r\n\r\nCi vorranno circa 2 minuti:\r\n\r\nGuanciale in padella - Ricetta carbonara\r\nnel frattempo lacqua sar arrivata a bollore, cuocete gli spaghetti.\r\n\r\n Come fare la crema di tuorli per una Carbonara perfetta\r\nMescolate i tuorli con la maggior parte del pecorino (lasciatene 1 cucchiaino per il condimento) e pepe. Aggiungete 1 cucchiaio di acqua di cottura della pasta per evitare leffetto frittata.\r\n\r\nLa cremina devessere morbida, ma allo stesso tempo corposa e vellutata. Dal colore intenso quindi non troppo pallido.\r\n\r\nCome fare la crema di tuorli - Ricetta Spaghetti alla carbonara\r\nTrucchi e Consigli per Spaghetti alla carbonara cremosi\r\nScolate gli spaghetti super al dente direttamente nella padella calda del guanciale  (tenendo da parte acqua di cottura)\r\n\r\nPoi aggiungete  2  3  cucchiai di acqua di cottura della pasta. Saltate tutto insieme per 1 minuto su fuoco vivo.\r\n\r\nInfine spegnete il fuoco e allontanate la padella dai fornelli e versate la cremina di tuorli sugli spaghetti a fuoco spento. Amalgamate qualche secondo, mantecate con pecorino, con 1  2 cucchiai di acqua di cottura bollente per favorire la cremosit e pepe!\r\n\r\necco pronti i vostri Spaghetti alla carbonara caldi e succulenti ; serviteli con una spolverata leggera di pecorino e un pizzico di pepe!', 2, '2022-02-28', 1, 'Spaghetti alla Carbonara', 2, 13, 5),
(14, 'a:5:{i:0;s:22:\"Polpa di pomodoro 250g\";i:1;s:21:\"2 Fettine di vitello \";i:2;s:15:\"Olio 2 cucchiai\";i:3;s:8:\"sale q.b\";i:4;s:16:\"Spicchio d\'aglio\";}', 'Prima di tutto preparate il sugo alla pizzaiola, ponendo in una padella larga lo spicchio daglio sbucciato e un filo dolio, scaldate per 1 minuto a fuoco vivace, aggiungete la polpa , una manciata di origano.\r\n\r\nPoi lasciate cuocere con coperchio per 7  8 minuti, dovrete ottenere un sugo corposo, saporito e non liquido!\r\n\r\nTrascorso il tempo indicato sollevate il coperchio, assaggiate e aggiungete sale se necessario.\r\n\r\nInfine nel sugo bollente, aggiungete le fettine:\r\n\r\ncome fare la carne alla pizzaiola\r\nLasciate cuocere 1 minuto per parte, coprendo completamente di sugo aggiungendo una manciata di origano . Per me sono perfette cos a pochissima cottura! Voi valutate in base allo spessore se necessitano ancora mezzo minuto per parte!\r\n\r\nAttenzione che se cuocete pi di 3 minuti inizieranno a perdere morbidezza! Se invece volete la carne ben cotta, potete prolungare la cottura di qualche secondo.\r\n\r\nEcco pronta la vostra Carne alla pizzaiola!\r\nServite nel piatto con abbondante sugo!', 3, '2022-03-01', 2, 'Carne alla pizzaiola', 2, 14, 0),
(15, 'a:6:{i:0;s:12:\"Avocado 500g\";i:1;s:17:\"Succo di lime 35g\";i:2;s:18:\"Un pomodoro ramato\";i:3;s:18:\"Cipolla bianca 35g\";i:4;s:15:\"Coriandolo q.b.\";i:5;s:9:\"Sale q.b.\";}', 'Per preparare il guacamole, per prima cosa mondate e tritate finemente la cipolla, poi tritate anche il coriandolo. Dividete lavocado a met ed estraete il nocciolo.\r\nPrelevate la polpa con laiuto di un cucchiaio e versatela allinterno di un mortaio. Aggiungete il succo di lime e cominciate a pestare fino ad ottenere una crema.\r\nUnite anche la cipolla tritata e il coriandolo e pestate ancora per amalgamare il tutto, poi aggiustate di sale. Se vi piace il piccante, a questo punto potete aggiungere del peperoncino fresco o qualche goccia di tabasco.\r\nIn ultimo riducete il pomodoro a dadini e aggiungetelo sulla salsa. La vostra salsa guacamole  pronta per essere servita!', 1, '2022-03-09', 2, 'Guacamole', 6, 15, 0),
(16, 'a:7:{i:0;s:28:\"Patate (a pasta gialla) 1 kg\";i:1;s:15:\"Aglio 2 spicchi\";i:2;s:14:\"Sale fino q.b.\";i:3;s:19:\"Rosmarino 2 rametti\";i:4;s:30:\"Olio extravergine d\'oliva 30 g\";i:5;s:14:\"Pepe nero q.b.\";i:6;s:14:\"Timo 2 rametti\";}', 'Per preparare le patate al forno come prima cosa lavatele bene e sbucciatele. Dividete le patate a met per il senso della lunghezza e poi in quarti.\r\nDa queste ricavate dei cubetti grandi un paio di cm e man mano trasferitele in una ciotola. In una pentola portate ad ebollizione abbondante acqua e immergete le patate.\r\nSbollentatele per 7 minuti quindi scolatele e trasferitele nuovamente in una ciotola. Aromatizzate con le foglioline di timo.\r\nAggiungete sale, pepe, olio e mescolate bene con un cucchiaio.\r\nTrasferite le patate in una teglia di alluminio dai bordi bassi precedentemente unta. Aggiungete dei rametti di rosmarino e due spicchi d\'aglio. Cuocete le patate in forno ventilato preriscaldato a 220, nel ripiano centrale, per 40 minuti o fino a quando le patate non risulteranno ben dorate. A met cottura si raccomanda di mescolare delicatamente le patate per una doratura uniforme. A cottura ultimata sfornate le vostre patate al forno, togliete gli spicchi d\'aglio e servitele .', 4, '2022-03-09', 2, 'Patate al Forno', 4, 16, 0),
(17, 'a:6:{i:0;s:10:\"Burro 25 g\";i:1;s:15:\"Farina 00 125 g\";i:2;s:12:\"Uova medie 2\";i:3;s:25:\"Latte intero fresco 200 g\";i:4;s:32:\"Lievito in polvere per dolci 6 g\";i:5;s:13:\"Zucchero 15 g\";}', 'Iniziamo la preparazione dei pancake fondendo il burro a fuoco bassissimo, quindi lasciate intiepidire. Intanto dividete gli albumi dai tuorli. Versate i tuorli in una ciotola e sbatteteli con una frusta a mano, poi unite il burro fuso a temperatura ambiente e il latte a filo, continuando sempre a mescolare con la frusta. Montate il composto finch non risulter chiaro.\r\nUnite il lievito alla farina e setacciate tutto nella ciotola con il composto di uova, mescolate con la frusta per amalgamare.\r\nOra montate gli albumi che avete tenuto da parte, versando poco alla volta lo zucchero e quando saranno bianchi e spumosi incorporateli delicatamente al composto di uova, con movimenti dall\'alto verso il basso, per evitare di smontarli. Mettete a scaldare sul fuoco medio (non alto altrimenti non darete il tempo all\'impasto di lievitare bene durante la cottura e i pancake diventeranno troppo scuri) una padella ampia antiaderente (meglio se a fondo spesso) e, se necessario, ungete con poco burro da spandere sulla superficie con l\'aiuto di carta da cucina. Versate al centro del pentolino un mestolino di preparato, non ci sar bisogno di spanderlo.\r\nQuando inizieranno a comparire delle bollicine in superficie e la base sar dorata, giratelo sullaltro lato per mezzo di una spatolina, come se fosse una crepe o una frittata, quindi fate dorare a sua volta anche l\'altro lato, dopodich il pancake sar pronto. Proseguite cos con il resto dell\'impasto e man a mano disponete i pancake su un piatto da portata, impilateli uno sopra l\'altro. Con queste dosi dovrebbero formarsi all\'incirca 12 pancake. Serviteli caldi e cosparsi di sciroppo dacero. Potete accompagnare i pancake con della frutta fresca o sciroppata di vostro gusto.', 6, '2022-03-09', 2, 'Pancake allo sciroppo d\'acero', 4, 17, 0),
(18, 'a:8:{i:0;s:13:\"Fusilli 320 g\";i:1;s:16:\"Mozzarella 125 g\";i:2;s:16:\"Aglio 1 spicchio\";i:3;s:25:\"Passata di pomodoro 500 g\";i:4;s:30:\"Olio extravergine d\'oliva 30 g\";i:5;s:14:\" Basilico q.b.\";i:6;s:14:\"Sale fino q.b.\";i:7;s:43:\"Parmigiano Reggiano DOP da grattugiare 65 g\";}', 'Per preparare la pasta alla sorrentina cominciate preparando il sugo. In una padella capiente versate lolio e aggiungete lo spicchio daglio sbucciato, soffriggete per 1 minuto e poi versate la passata di pomodoro. Regolate di sale, unite qualche fogliolina di basilico e mescolate.\r\nA questo punto coprite col coperchio e lasciate cuocere per 30 minuti a fuoco dolce. A fine cottura ricordate di eliminare lo spicchio daglio. Ponete sul fuoco a scaldare una pentola colma d\'acqua che servir per la cottura della pasta e intanto occupatevi di tagliare a cubetti la mozzarella. Quando l\'acqua avr raggiunto il bollore cuocete la pasta.\r\ne scolatela al dente, direttamente nel sugo; mescolate per amalgamare. Versate circa met della pasta in una pirofila da 25 cm di diametro, cos da fare un primo strato sullo stesso poi aggiungete met dei cubetti di mozzarella e spolverizzate con un po di Parmigiano. Ricoprite con la pasta restante, poi aggiungete la mozzarella ed infine ricoprite con il Parmigiano. Ripassate in forno con la modalit grill impostata per circa 5 minuti, fino a che la pasta non risulter ben gratinata e la mozzarella fusa (se non avete il grill potete mettere la teglia sul ripiano pi alto e accendere il forno alla massima potenza, facendo per attenzione che non bruci!). Guarnite la vostra pasta alla sorrentina, con del basilico fresco e portate subito in tavola!', 2, '2022-03-09', 1, 'Pasta alla Sorrentina', 4, 18, 0),
(19, 'a:5:{i:0;s:32:\"Cioccolato fondente al 70% 110 g\";i:1;s:34:\"Burro a temperatura ambiente 110 g\";i:2;s:21:\"Uova (2 grandi) 120 g\";i:3;s:13:\"Zucchero 40 g\";i:4;s:14:\"Farina 00 25 g\";}', 'Per realizzare il tortino di cioccolato con cuore fondente per prima cosa sciogliete il cioccolato a bagnomaria insieme al burro, mescolando continuamente. Una volta sciolto, lasciatelo raffreddare fino alla temperatura di 30. Se non avete un termometro potete lasciarlo a temperatura ambiente per circa 20-25 minuti. Nel frattempo imburrate e infarinate 4 stampini di alluminio.\r\nQuando avr raggiunto i 30, trasferite il composto di burro e cioccolato in un mixer con lame di acciaio. Mentre il mixer  in funzione unite lo zucchero allinterno e aspettate che sia ben amalgamato, poi versate a filo le uova sbattute.\r\nQuando anche le uova saranno state assorbite aggiungete la farina e continuate a frullare per ottenere un composto liscio e omogeneo. Riempite gli stampini con 70 g di composto luno, aiutandovi con un sac--poche o un cucchiaio; il composto dovr arrivare a circa due terzi dello stampino.\r\nMettete gli stampini in congelatore per almeno 6 ore, meglio se per una notte intera. Quando i tortini saranno congelati, disponeteli in una teglia e cuocete in forno ventilato preriscaldato a 200 per 7 minuti, sul ripiano medio.\r\nTrascorso il tempo di cottura, sformateli delicatamente capovolgendo gli stampini sul piatto, poi spolverizzate con zucchero a velo e servite subito il vostro tortino di cioccolato con cuore fondente!', 6, '2022-03-09', 1, 'Tortino di cioccolato con cuore fondente', 2, 19, 0),
(20, 'a:7:{i:0;s:20:\"Petto di pollo 200 g\";i:1;s:10:\" Albumi \";i:2;s:44:\"Olio di semi di arachide (o di girasole) 5 g\";i:3;s:10:\"Acqua 20 g\";i:4;s:20:\"Fecola di patate 5 g\";i:5;s:14:\"Sale fino q.b.\";i:6;s:25:\"Pepe bianco (o nero) q.b.\";}', 'Per preparare il pollo alle mandorle, per prima cosa tagliate i germogli di bamb a cubetti abbastanza piccoli. Riducete a cubetti anche il petto di pollo, avendo cura che siano della stessa dimensione del bamb. Ora mettete il pollo in un colino e sciacquatelo con un po di acqua: in questo modo risulter pi morbido.\r\nTrasferite il pollo in una ciotola e aggiungete mezzo albume, sale, pepe bianco e olio di semi.\r\nUnite anche lacqua e la fecola di patate e mescolate bene; in alternativa alle bacchette potete massaggiare il pollo con le mani. Coprite la ciotola con pellicola e lasciate riposare il pollo per 10 minuti cos assorbir i sapori della marinatura.\r\nNel frattempo scaldate abbondante olio di semi in un wok avendo cura che arrivi a una temperatura di 180 altrimenti le mandorle rischieranno di bruciarsi. Tuffate le mandorle nellolio bollente e friggete per circa un minuto, mescolando spesso. Scolate le mandorle e trasferitele in una ciotola.\r\nPortate a bollore una pentola di acqua e sbollentate il pollo per 2 minuti, poi scolate e tenete da parte. Cambiate lacqua e portatela nuovamente a bollore, poi versate i germogli di bamb.\r\nCuocete il bamb per 5 minuti a fuoco medio, con il coperchio, poi scolate e tenete da parte. A questo punto potete assemblare tutti gli ingredienti: scaldate il wok che avrete precedentemente pulito, poi aggiungete lolio di semi e il pollo.\r\nUnite anche il bamb e mescolate per un minuto a fuoco alto, poi versate lacqua, continuando sempre a girare.\r\nAggiungete il sale, la salsa di soia scura e quella chiara. Continuate a mescolare e, quando il colore sar diventato omogeneo, unite anche le mandorle. Amalgamate il tutto e spegnete il fuoco.\r\nIn una ciotolina a parte sciogliete la fecola in una piccola quantit di acqua. Rimettete il wok sul fuoco medio e aggiungete il composto con la fecola: in questo modo otterrete una consistenza molto cremosa. Mescolate sempre per amalgamare bene il tutto e impiattate. Il vostro pollo alle mandorle  pronto per essere servito accompagnato con riso basmati!', 3, '2022-03-09', 1, 'Pollo alle mandorle', 4, 20, 0);

